import React, { useState } from "react";
import Button from "react-bootstrap/Button";
import { MDBCol, MDBRow } from "mdbreact";
import "./Category.css";
import Card from "react-bootstrap/Card";
import MinyCard from "../MinyCard";
i

function Category(props) {
  const { dataCard } = props;
  const [show, setShow] = useState(false);
  const [name, setName] = useState("");
  // const category=["Featured Auckland deals","Collections","Escapes","Activities, Events & Outdoors"]
  return (
    <div className="Category">
      {!show ? (
        <div className="all-Categories">
          <div className="card">
                {dataCard.map((elem) => {
                  return (
                    <div key={elem.categoryId}>
                      {elem.categoryId ? (
                        <div className="allCards">
                          {dataCard.map((elem) => {
                            if (elem.categoryId) {
                              dataCard.filter((i)=>{
                                console.log( "++++++++++++++++++++++",i.category)
                                return i.category === elem.category
                              }
                              )
                              return (
                                <div>
                                  <MDBRow>
                                    <MDBCol md="3">
                                      <h2> {elem.category}</h2>
                                    </MDBCol>
                                    <MDBCol md="3">
                                      {" "}
                                      <Button
                                        className="CategoriesButton"
                                        variant="outline-secondary"
                                        id="button-addon2"
                                      >
                                        View More
                                      </Button>
                                    </MDBCol>
                                    <MinyCard dataCard={data} />
                                  </MDBRow>
                                 
                                </div>
                              );
                            }
                          })}
                        </div>
                      ) : null}
                    </div>
                  );
                })}
    
            <MDBRow></MDBRow>
          </div>
          <div className="card">
            <MDBRow>
              <MDBCol md="3">
                <h2 style={{ textAlign: "left" }}>Collections</h2>
              </MDBCol>
              <MDBCol md="3">
                {" "}
                <Button
                  className="CategoriesButton"
                  variant="outline-secondary"
                  id="button-addon2"
